import React, { useEffect, useState } from "react";
import "./App.css";

const SLACK_WEBHOOK_URL = "YOUR_SLACK_WEBHOOK_URL"; // 여기에 Slack Webhook URL을 입력하세요.

const App = () => {
  const [data, setData] = useState([]);
  const [anomalies, setAnomalies] = useState([]);

  const detectAnomalies = (newData) => {
    const threshold = 2; // 이상 감지를 위한 임계값 (예: Z-점수)
    const detectedAnomalies = [];

    for (let i = 1; i < newData.length; i++) {
      const prevData = newData[i - 1];
      const currentData = newData[i];

      // 이상 감지 알고리즘 (예: Z-점수)을 사용하여 여기에서 이상을 감지
      const zScore = Math.abs(
        (currentData.temperature - prevData.temperature) /
          standardDeviation(newData.map((point) => point.temperature))
      );

      if (zScore > threshold) {
        detectedAnomalies.push(i);
      }
    }

    return detectedAnomalies;
  };

  const standardDeviation = (values) => {
    const n = values.length;
    const mean = values.reduce((acc, value) => acc + value, 0) / n;
    const variance =
      values.reduce((acc, value) => acc + Math.pow(value - mean, 2), 0) / n;
    return Math.sqrt(variance);
  };

  useEffect(() => {
    const interval = setInterval(() => {
      const newPoint = {
        timestamp: new Date().toISOString(),
        temperature: Math.random() * 30 + 10,
        pressure: Math.random() * 30 + 900,
        level1_chemical: Math.random() * 50 + 50,
        level2_chemical: Math.random() * 50 + 50,
      };

      setData((prevData) => [newPoint, ...prevData]);

      const detectedAnomalies = detectAnomalies([newPoint, ...prevData]);
      setAnomalies(detectedAnomalies);

      // Slack 알림 보내기
      if (detectedAnomalies.length > 0) {
        sendSlackNotification(detectedAnomalies.length);
      }
    }, 5000);

    return () => clearInterval(interval);
  }, []);

  const sendSlackNotification = (anomalyCount) => {
    fetch(SLACK_WEBHOOK_URL, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ text: `이상 감지: ${anomalyCount}건` }),
    })
      .then((response) => response.json())
      .then((data) => console.log("Slack 알림 전송", data))
      .catch((error) => console.error("Slack 알림 전송 오류", error));
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>화학 공장 모니터링</h1>
      </header>
      <div className="data-container">
        <h2>실시간 데이터</h2>
        <table>
          <thead>
            <tr>
              <th>시간</th>
              <th>온도</th>
              <th>압력</th>
              <th>화학1</th>
              <th>화학2</th>
            </tr>
          </thead>
          <tbody>
            {data.map((point, index) => (
              <tr
                key={index}
                className={anomalies.includes(index) ? "anomaly" : ""}
              >
                <td>{point.timestamp}</td>
                <td>{point.temperature.toFixed(2)}</td>
                <td>{point.pressure.toFixed(2)}</td>
                <td>{point.level1_chemical.toFixed(2)}</td>
                <td>{point.level2_chemical.toFixed(2)}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default App;
